import React, { useState, useEffect } from 'react';
import { getResources } from '../services/api';
import { Bell, Globe } from 'lucide-react';

const UserWorkspace = ({ user }) => {
  const [resources, setResources] = useState([]);

  useEffect(() => {
    const fetchResources = async () => {
      try {
        const response = await getResources();
        setResources(response.data);
      } catch (error) {
        console.error('Error fetching resources:', error);
      }
    };

    fetchResources();
  }, []);

  return (
    <div className="flex flex-col h-screen">
      {/* Header */}
      <header className="bg-indigo-900 text-white p-4 flex justify-between items-center">
        <div className="flex items-center">
          <span className="text-2xl font-bold mr-2">ðŸš¢</span>
          <h1 className="text-2xl font-bold">Oceania PMIS</h1>
        </div>
        <div className="flex items-center">
          <Globe className="mr-4" />
          <span className="mr-2">EN</span>
          <Bell className="mr-4" />
          <img src={user.photoURL || "/api/placeholder/40/40"} alt="User" className="w-10 h-10 rounded-full mr-2" />
          <div className="flex flex-col">
            <button className="bg-blue-700 text-white px-3 py-1 rounded">Logout</button>
            <button className="text-white text-sm">Profile</button>
          </div>
        </div>
      </header>

      {/* Main content */}
      <div className="flex flex-1 overflow-hidden">
        {/* Sidebar */}
        <nav className="bg-gray-200 w-64 p-4">
          <ul>
            <li className="mb-2 font-bold">Dashboard</li>
            <li className="mb-2">Assets and Facilities</li>
            <li className="mb-2">Manpower</li>
            <li className="mb-2">Vessel Visits</li>
            <li className="mb-2">Port Operations and Resources</li>
            <li className="mb-2">Cargos</li>
            <li className="mb-2">Financial</li>
            <li className="mb-2">Customs and Trade Documents</li>
            <li className="mb-2">Settings</li>
          </ul>
        </nav>

        {/* Dashboard content */}
        <main className="flex-1 p-8 overflow-auto">
          <h2 className="text-2xl font-bold mb-6">Dashboard</h2>
          <p className="text-xl mb-6">Good to see you, {user.displayName} ðŸ‘‹</p>

          {/* Leave statistics */}
          <div className="grid grid-cols-4 gap-4 mb-8">
            {[
              { title: "Total leave allowance", value: 34, paid: 11, unpaid: 4 },
              { title: "Total leave taken", value: 20, paid: 62, unpaid: 76 },
              { title: "Total leave available", value: 87, paid: 50, unpaid: 51 },
              { title: "Leave request pending", value: 122, paid: 60, unpaid: 53 },
            ].map((stat, index) => (
              <div key={index} className="bg-white p-4 rounded shadow">
                <h3 className="font-bold mb-2">{stat.title}</h3>
                <p className="text-2xl font-bold text-blue-600">{stat.value}</p>
                <p className="text-sm">
                  Paid: <span className="font-bold">{stat.paid}</span> Unpaid:{" "}
                  <span className="font-bold">{stat.unpaid}</span>
                </p>
              </div>
            ))}
          </div>

          {/* Time Log */}
          <div className="bg-white p-6 rounded shadow mb-8">
            <h3 className="text-xl font-bold mb-4">Time Log</h3>
            <div className="flex justify-between mb-4">
              <div>
                <h4 className="font-bold">Today</h4>
                <p>08:00 Scheduled</p>
                <p>12:00 Balance</p>
                <p>05:00 Worked</p>
              </div>
              <div>
                <h4 className="font-bold">This month</h4>
                <p>Total: 216 hours</p>
                <p>Worked time: 189 hours</p>
                <p>Shortage time: 23 hours</p>
                <p>Over time: 56 hours</p>
              </div>
            </div>
          </div>

          {/* Latest Service Operations */}
          <div className="bg-white p-6 rounded shadow">
            <h3 className="text-xl font-bold mb-4">Latest Service Operations</h3>
            <table className="w-full">
              <thead>
                <tr className="text-left">
                  <th>Title</th>
                  <th>Status</th>
                  <th>Latest Update</th>
                  <th>Description</th>
                </tr>
              </thead>
              <tbody>
                {[
                  { title: "Unload cargo", status: "Ready", date: "Dec 7, 2019 23:26", description: "Bob is requesting to unload" },
                  { title: "Unload cargo", status: "Ready", date: "Feb 2, 2019 19:28", description: "Bob is requesting to unload" },
                  { title: "Unload cargo", status: "Ready", date: "Dec 4, 2019 21:42", description: "Bob is requesting to unload" },
                  { title: "Unload cargo", status: "Ready", date: "Feb 2, 2019 19:28", description: "Bob is requesting to unload" },
                  { title: "Unload cargo", status: "Ready", date: "Dec 4, 2019 21:42", description: "Bob is requesting to unload" },
                ].map((operation, index) => (
                  <tr key={index}>
                    <td>{operation.title}</td>
                    <td>{operation.status}</td>
                    <td>{operation.date}</td>
                    <td>{operation.description}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </main>
      </div>
    </div>
  );
};

export default UserWorkspace;
